import React from "react";
import days from "../6plates";
import Card from "./Card";

function Shedule() {
  return (
    <><div className="card">
      <Card
        name={days[0].name} 
        img={days[0].imgurl} 
        />
    </div><div className="card">
        <Card
          name={days[1].name} />
      </div><div className="card">
        <Card
          name={days[2].name} />
      </div><div className="card">
        <Card
          name={days[3].name} />
      </div><div className="card">
        <Card
          name={days[4].name} />
      </div><div className="card">
        <Card
          name={days[5].name} />
      </div></>
  );
}

export default Shedule;
